import React from 'react';
import { Drawer } from '@material-ui/core';

class Navdrawer extends React.Component {
    constructor(props: any) {
        super(props);
    }
    render() {
        return (
            <div className="NavigationDrawer">
              <Drawer
                variant="temporary"
                ModalProps={{
                    keepMounted: true,
                }}
                />
            </div>
        );
    }
}

export default Navdrawer;
